import React from 'react';
import classes from './ToDoList.module.scss';
import ToDoItem from './ToDoItem';


const ToDoList = () => {
    const styles = {
        list: 'none',
        color: 'white'
    }
    return (
        <div className={classes.toDoWrapper}>
            <ul>
                <ToDoItem />
                <ToDoItem />
            </ul>
        </div>
    )

}



export default ToDoList;
